import React from "react";
import Tilt from "react-parallax-tilt";
import brain from './brain.svg';


function Logo() {
  return (
    <div className="ma4">
      <Tilt
        className="Tilt shadow"
        style={{ height: 150, width: 150 }}
      >
        <div className="Tilt-inner"><img src = { brain } alt = 'logo' /></div>
      </Tilt>
    </div>
  );
}

export default Logo;
